public class GameManager : MonoBehaviour {
  public string username = "march17";
	public string password = "anything";

  private AccountsManager _accountsManager;
	private AccountListVertical _accountListVertical;
	private BudgetsManager _budgetsManager;
	private BudgetSpawner _budgetSpawner;
	private CategoryManager _categoryManager;
	private MembersManager _membersManager;
	private SpendingManager _spendingManager;
	private TransactionManager _transactionManager;
	private TransactionListVertical _transactionListVertical;

	private List<AccountCollection> _account_collection_list;
	private List<BudgetCollection> _budget_collection_list;
	private List<CategoryCollection> _category_collection_list;
	private List<MemberCollection> _member_collection_list;
	private List<TransactionCollection> _transaction_collection_list;

	private float _update_timer = 0.0f;

	// Temp
	public float _account_select_delay = 1.0f;
	private float _account_select_current = 0.0f;
	private int _account_select_index = 0;

	// Use this for initialization
	public void Start () {
		_account_collection_list = new List<AccountCollection>();
		_budget_collection_list = new List<BudgetCollection>();
		_category_collection_list = new List<CategoryCollection>();
		_member_collection_list = new List<MemberCollection>();
		_transaction_collection_list = new List<TransactionCollection>();

		_startSync();

		if (_accountsManager == null) {
			_accountsManager = (AccountsManager)FindObjectOfType(typeof(AccountsManager));
			_sendAccountData();
		}

		if (_accountListVertical == null) {
    	_accountListVertical = (AccountListVertical)FindObjectOfType(typeof(AccountListVertical));
		}

    if (_budgetsManager == null) {
			_budgetsManager = (BudgetsManager)FindObjectOfType(typeof(BudgetsManager));
			_sendBudgetData();
		}

		if(_budgetSpawner== null) {
			_budgetSpawner = (BudgetSpawner)FindObjectOfType(typeof(BudgetSpawner));
		}

    if (_categoryManager == null) {
			_categoryManager = (CategoryManager)FindObjectOfType(typeof(CategoryManager));
			_sendCategoryData();
		}

    if (_membersManager == null) {
			_membersManager = (MembersManager)FindObjectOfType(typeof(MembersManager));
			_sendMemberData();
		}

		if (_spendingManager== null) {
			_spendingManager = (SpendingManager)FindObjectOfType(typeof(SpendingManager));
		}

    if (_transactionManager == null) {
			_transactionManager = (TransactionManager)FindObjectOfType(typeof(TransactionManager));
			_sendTransactionData();
		}

		if (_transactionListVertical == null) {
    	_transactionListVertical = (TransactionListVertical)FindObjectOfType(typeof(TransactionListVertical));
		}
	}
	
	// Update is called once per frame
	public void Update () {

		_updateSync();
		
		if (_allDataRetrieved()) {
			_updateSelectedAccount();
		}
	}

	protected bool _allDataRetrieved() {
		return _account_collection_list.Count > 0 && 
					 _budget_collection_list.Count > 0 && 
					 _transaction_collection_list.Count > 0;
	}

	protected void _updateSelectedAccount() {
		// Data Retrieved and populated to what elements exist in the scene, now set up any interaction

		// Temp: Select through accounts in order and send data to the related views in the scene
		_account_select_current += Time.deltaTime;
		if (_account_select_current  > _account_select_delay) {
			_account_select_current -= _account_select_delay;
			var accounts = _account_collection_list[0].items;
			var account = accounts[_account_select_index];
			// Debug.Log("Select Account " + account.name + " (" + _account_select_index + ") + " + account.guid);
			if (_accountListVertical != null) {
				_accountListVertical.SelectAccount(_account_select_index);
			}
			if (_transactionListVertical != null) {
				var transactions = _transactionManager.GetTransactions(account.guid);
				_transactionListVertical.SetTransactions(transactions);
			}
			_account_select_index = ++_account_select_index %  accounts.Length;
		}
	}

	protected void _sendAccountData() {
		if (_accountsManager && _account_collection_list.Count > 0) {
			_accountsManager.SetAccounts(_account_collection_list[0].items);
		}
	}

	protected void _sendBudgetData() {
		if (_budgetsManager && _budget_collection_list.Count > 0) {
			_budgetsManager.SetBudgets(_budget_collection_list[0].items);
		}
	}

	protected void _sendCategoryData() {
		if (_categoryManager && _category_collection_list.Count > 0) {
			_categoryManager.SetCategories(_category_collection_list[0].items);
		}
	}

	protected void _sendMemberData() {
		if (_membersManager && _member_collection_list.Count > 0) {
			_membersManager.SetMembers(_member_collection_list[0].items);
		}
	}

	protected void _sendTransactionData() {
		for (int ii = 0; ii < _transaction_collection_list.Count; ii++) {
			bool last_entry = ii == _transaction_collection_list.Count - 1;
			if (_transactionManager) {
				_transactionManager.AddTransactions(_transaction_collection_list[ii].items, last_entry);
			}
			if (_spendingManager) {
				_spendingManager.AddTransactions(_transaction_collection_list[ii].items, last_entry);
			}
		}
	}

#if LOAD_REAL_DATA
	[UnmanagedFunctionPointer(CallingConvention.Cdecl)]
	public delegate void LoginDelegate(bool success);

	[UnmanagedFunctionPointer(CallingConvention.Cdecl)]
	public delegate void SyncDelegate(string model);

	[DllImport("moneymobilex_unity")]
	private static extern int connectivityCheck();

	[DllImport("moneymobilex_unity")]
	private static extern void login(string username, string password, [MarshalAs(UnmanagedType.FunctionPtr)]LoginDelegate functionCallback);

	[DllImport("moneymobilex_unity")]
	private static extern IntPtr getModel(string modelJson);

	[DllImport("moneymobilex_unity")]
	private static extern void syncModel(string modelName, [MarshalAs(UnmanagedType.FunctionPtr)]SyncDelegate functionCallback);

	[DllImport("moneymobilex_unity")]
	private static extern void update();

	private void _startSync() {
		var connectivity = connectivityCheck();
		Debug.Log("GaneManager Connectivity Check: " + connectivity.ToString());
		Debug.Log("GameManager Load Data: Username: " + username + ", Password: ********");
		login(username, password, HandleLogin);
	}

	public void HandleLogin(bool success) {
			Debug.Log("GaneManager: login (" + success.ToString() + ")");

			syncModel("accounts", HandleSync);
			syncModel("budgets", HandleSync);
			syncModel("categories", HandleSync);
			syncModel("members", HandleSync);
			syncModel("transactions", HandleSync);
	}

	public void HandleSync(string modelName) {
		  // TODO: This may need to be made thread-safe
			IntPtr models = getModel(modelName);
			string model_json = Marshal.PtrToStringAnsi(models);
			//Debug.Log("GaneManager: getModel(" + modelName + ") " + model_json);

			//Update Data
			if (modelName == "accounts") {
				_account_collection_list.Add(JsonUtility.FromJson<AccountCollection>(model_json));
				_sendAccountData();
			} else if (modelName == "budgets") {
				_budget_collection_list.Add(JsonUtility.FromJson<BudgetCollection>(model_json));
				_sendBudgetData();
			} else if (modelName == "categories") {
				_category_collection_list.Add(JsonUtility.FromJson<CategoryCollection>(model_json));
				_sendCategoryData();
			} else if (modelName == "members") {
				_member_collection_list.Add(JsonUtility.FromJson<MemberCollection>(model_json));
				_sendMemberData();
			} else if (modelName == "transactions") {
				_transaction_collection_list.Add(JsonUtility.FromJson<TransactionCollection>(model_json));
				_sendTransactionData();
			}
	}

	private void _updateSync() {
		// Heartbeat every 1 second
		_update_timer += Time.deltaTime;
		if (_update_timer > 1.0f) {
			_update_timer -= 1.0f;
			update();
		}
	}
	
#else // Load Hacked Data
	private void _startSync() {
	}

	private void _updateSync() {
		if(_allDataRetrieved()) return;

		// Wait 1 second to load data
		_update_timer += Time.deltaTime;
		if (_update_timer > 1.0f) {
			_loadAccountsJson();
			_loadBudgetsJson();
			_loadCategoriesJson();
			_loadMembersJson();
			_loadTransactionsJson();
		}
	}

